    true,nt"url": null,nt"notes": "Contains both (front file and backfile)
    pending and registered trademark text data (no drawings/images) to include word
    mark, serial number, registration number, filing date, registration date, goods
    and services, classification number(s), status code(s), design search code(s), pseudo
    mark(s) from the April 7, 1884 - Present. The file format is eXtensible Markup Language
    (XML) in accordance with the U.S. Trademark Applications Version 2.0 Document Type
    Definition (DTD). The backfile contains (April 7, 1884 - December 31, 2014) and
    includes (50) individual zipfiles (apc141231-01.zip - apc141231-50.zip). The front
    file contains (January 2015 - Present) and includes an apcyymmdd.zip file for each
    day. Within each daily zipfile are: apcyymmdd.xml  Approx. 17 MB per daily zipfile.
